import logo from './logo.svg';
import illi_logo from './illi_logo.jpg';
import './App.css';
import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <header className="App-header">
        <img src={illi_logo} className="illi_logo" alt="Illi Logo"/>
        <nav  className="Header-nav">
          <ul>
            <li> Project </li>
            <li> About </li>
            <li> Contact </li>
          </ul>
        </nav>
      </header>
    )
  }
}

class Body extends Component {
  render() {
    return (
      <div className="App-body">
          <div className="Body-content"> 
          dd
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          {/* <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br> */}
           {/* <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br>
          <br></br><br></br><br></br><br></br><br></br><br></br><br></br> */}
          aa
          </div>
      </div>
    )
  }
}

class Footer extends Component {
  render() {
    return (

      <footer className="App-footer">
        <div className="footer-layout">
          <div className="footer-text">
            <span> (주) 일리소프트 (734 - 81 - 01722) </span>
            <span> 안산시 상록구 한양대학로 55(사동, 창업센터) (5공학관 지하) </span>
            <span> 대표 안호준  HP : 010 - 4345 - 7940 </span>
            <span> illisoftofficial@gmail.com </span>
          </div>
          <div className="footer-image">
            <a></a>
          </div>

        </div>

      </footer>
    )
  }
}


function App() {
  return (
    <div className="App">

      <Header></Header>

      <Body></Body>

      <Footer></Footer>

    </div>
  );
}

export default App;
